DROP TABLE IF EXISTS `caixa` CASCADE;
CREATE TABLE `caixa` (
	`id` int NOT NULL,
	`tipo` varchar(50),
	`descricao` varchar(255),
	`valor` float,
	`data` datetime,
	`mes` varchar(20),
	`ano` int,
	PRIMARY KEY (`id`),
	INDEX `id` (`id` ASC)
);


DROP TABLE IF EXISTS `Clientes` CASCADE;
CREATE TABLE `Clientes` (
	`ID` int NOT NULL,
	`cod_cli` varchar(50),
	`nome` varchar(255),
	`cnpj` varchar(50),
	`ie` varchar(50),
	`endereco` varchar(255),
	`cidade` varchar(50),
	`estado` varchar(2),
	`cep` varchar(50),
	`telefone` varchar(50),
	`fax` varchar(50),
	`email` varchar(50),
	`obs` varchar(255),
	PRIMARY KEY (`ID`),
	INDEX `cod_cli` (`cod_cli` ASC),
	INDEX `ID` (`ID` ASC)
);

            
            
            
