DROP TABLE IF EXISTS `compras` CASCADE;
CREATE TABLE `compras` (
	`ID` int NOT NULL,
	`cod_fornecedor` int,
	`data` datetime,
	`qnt` int,
	`preco` float,
	`desc` varchar(50),
	`ipi` varchar(50),
	`prazo` datetime,
	`cond` varchar(50),
	`contato` varchar(50),
	PRIMARY KEY (`ID`),
	INDEX `ID` (`ID` ASC)
);


DROP TABLE IF EXISTS `contas_desc` CASCADE;
CREATE TABLE `contas_desc` (
	`id` int NOT NULL,
	`descx` varchar(60),
	PRIMARY KEY (`id`),
	INDEX `id` (`id` ASC)
);


DROP TABLE IF EXISTS `contasapagar` CASCADE;
CREATE TABLE `contasapagar` (
	`ID` int NOT NULL,
	`vencimento` datetime,
	`descricao` int,
	`valor` float,
	`pago` char,
	`data_pagamento` datetime,
	PRIMARY KEY (`ID`),
	INDEX `ID` (`ID` ASC)
);


DROP TABLE IF EXISTS `controle` CASCADE;
CREATE TABLE `controle` (
	`id` int NOT NULL,
	`cod_item` int,
	`cod_cli` int,
	`gaveta` int,
	`quantidade` int,
	`data` datetime,
	PRIMARY KEY (`id`),
	INDEX `id` (`id` ASC)
);


DROP TABLE IF EXISTS `Erros ao colar` CASCADE;
CREATE TABLE `Erros ao colar` (
	`Tipo` varchar(255),
	`Numero_Os` int,
	`Data` datetime,
	`Prazo` datetime,
	`gravacao` varchar(255),
	`Ferramenta` varchar(255),
	`Material` varchar(255),
	`Especificacao` varchar(255),
	`Quantidade` int,
	`unidade` varchar(255),
	`Desenho_Cliente` varchar(255),
	`Desenho_Pimentel` varchar(255),
	`Numero_Nf` int,
	`Numero_Pedido` int,
	`Data_Nf` datetime,
	`Data_Pedido` datetime,
	`STATUS` varchar(255),
	`gravacao2` varchar(255)
);


DROP TABLE IF EXISTS `Estoque` CASCADE;
CREATE TABLE `Estoque` (
	`ID` int NOT NULL,
	`id_cliente` int,
	`ferramenta` varchar(50),
	`material` varchar(50),
	`cod_pc` varchar(50),
	`mm` varchar(50),
	`qt` int,
	`gaveta` int,
	`data` datetime,
	PRIMARY KEY (`ID`),
	INDEX `ID` (`ID` ASC),
	INDEX `id_cliente` (`id_cliente` ASC)
);


DROP TABLE IF EXISTS `Ferramenta` CASCADE;
CREATE TABLE `Ferramenta` (
	`ID` int NOT NULL,
	`Ferramenta` varchar(50),
	`Cod_ferramenta` varchar(50),
	`cod_cli` int,
	`mm` varchar(50),
	PRIMARY KEY (`ID`),
	INDEX `ID` (`ID` ASC)
);


DROP TABLE IF EXISTS `Fornecedores` CASCADE;
CREATE TABLE `Fornecedores` (
	`ID` int NOT NULL,
	`cod_for` varchar(50),
	`nome` varchar(255),
	`cnpj` varchar(50),
	`ie` varchar(50),
	`endereco` varchar(255),
	`cidade` varchar(50),
	`estado` varchar(2),
	`cep` varchar(50),
	`telefone` varchar(50),
	`fax` varchar(50),
	`email` varchar(50),
	`obs` text(8000),
	`qntcompras` int,
	PRIMARY KEY (`ID`),
	INDEX `ID` (`ID` ASC)
);


DROP TABLE IF EXISTS `funcionarios` CASCADE;
CREATE TABLE `funcionarios` (
	`id` int NOT NULL,
	`funcionario` varchar(50),
	`nome` varchar(50),
	`senha` varchar(50),
	PRIMARY KEY (`id`),
	INDEX `id` (`id` ASC)
);


DROP TABLE IF EXISTS `itens` CASCADE;
CREATE TABLE `itens` (
	`id` int NOT NULL,
	`descricao` varchar(50),
	`codigo` varchar(50),
	`material` varchar(50),
	`esp1` varchar(100),
	`esp2` varchar(50),
	`esp3` varchar(50),
	PRIMARY KEY (`id`),
	INDEX `id` (`id` ASC)
);


DROP TABLE IF EXISTS `Material` CASCADE;
CREATE TABLE `Material` (
	`ID` int NOT NULL,
	`material` varchar(50),
	`cod_material` varchar(50),
	PRIMARY KEY (`ID`),
	INDEX `ID` (`ID` ASC)
);


DROP TABLE IF EXISTS `notafiscal` CASCADE;
CREATE TABLE `notafiscal` (
	`id_nf` int NOT NULL,
	`numero_nf` int,
	`data_nf` datetime,
	`valor_nf` float,
	PRIMARY KEY (`id_nf`),
	INDEX `idnf` (`id_nf` ASC)
);


DROP TABLE IF EXISTS `numero_pedidos` CASCADE;
CREATE TABLE `numero_pedidos` (
	`id_pedido` int NOT NULL,
	`numero_pedido` int,
	`id_nf` int,
	PRIMARY KEY (`id_pedido`),
	INDEX `id_nf` (`id_nf` ASC),
	INDEX `id_pedido` (`id_pedido` ASC)
);


DROP TABLE IF EXISTS `orcamento` CASCADE;
CREATE TABLE `orcamento` (
	`ID` int NOT NULL,
	`numero` int,
	`ano` int,
	`cod_item` int,
	`data` varchar(50),
	`para` varchar(50),
	`attn` varchar(50),
	`refer` varchar(50),
	`de` varchar(50),
	`nref` varchar(50),
	`fax` varchar(50),
	`prazo_entrega` varchar(50),
	`prazo_pagto` varchar(50),
	`ipi` varchar(50),
	`icms` varchar(50),
	PRIMARY KEY (`ID`),
	INDEX `ID` (`ID` ASC)
);


DROP TABLE IF EXISTS `Pedidos` CASCADE;
CREATE TABLE `Pedidos` (
	`ID` int NOT NULL,
	`numero` int,
	`ano` int,
	`id_cliente` int,
	`id_ferramenta` int,
	`especificacao` varchar(50),
	`desenho` varchar(50),
	`gravacao` varchar(50),
	`unidade` varchar(50),
	`qnt` int,
	`preco` float,
	`data_entrada` datetime,
	`prazo` datetime,
	`qnt_acabada` int,
	`data_acabamento` datetime,
	`pedido_cliente` varchar(15),
	`numero_os` int,
	`status` int,
	PRIMARY KEY (`ID`),
	INDEX `ID` (`ID` ASC),
	INDEX `id_cliente` (`id_cliente` ASC),
	INDEX `id_ferramenta` (`id_ferramenta` ASC)
);


DROP TABLE IF EXISTS `ponto` CASCADE;
CREATE TABLE `ponto` (
	`id` int NOT NULL,
	`cod_func` int,
	`data` datetime,
	`hora` datetime,
	`tipo` varchar(50),
	PRIMARY KEY (`id`),
	INDEX `id` (`id` ASC)
);


DROP TABLE IF EXISTS `usuarios` CASCADE;
CREATE TABLE `usuarios` (
	`ID` int NOT NULL,
	`ds_login` varchar(50) NOT NULL,
	`ds_senha` varchar(50) NOT NULL,
	`nivel` int,
	`desc` varchar(50),
	PRIMARY KEY (`ID`),
	INDEX `ID` (`ID` ASC)
);


ALTER TABLE `Pedidos` ADD CONSTRAINT `CadastroPedidos` FOREIGN KEY (`id_cliente`) REFERENCES `Clientes` (`ID`) ON UPDATE CASCADE ON DELETE SET NULL;
ALTER TABLE `Cadastro_OS` ADD CONSTRAINT `ClientesCadastro_OS` FOREIGN KEY (`Id_Cliente`) REFERENCES `Clientes` (`ID`) ON UPDATE SET NULL ON DELETE SET NULL;
ALTER TABLE `controle` ADD CONSTRAINT `itenscontrole` FOREIGN KEY (`cod_item`) REFERENCES `itens` (`id`) ON UPDATE CASCADE ON DELETE CASCADE;


SET FOREIGN_KEY_CHECKS = 1;
